"""# First task (to group the modules' files into a single one for each module)

We want to load the data into our workspace. To do so, we are going to use the **pd.read_csv** function (https://pandas.pydata.org/pandas-docs/stable/reference/api/pandas.read_csv.html). This is a very powerful function that will read most types of data files into a dataframe, **the big exception is .xlsx files**. Take a look on the documentation of the function for more info and feel free to ask me questions.

**For the MOD modules** The data from modules named "mod1.txt" or "mod2.txt" should follow a certain nomenclature in which the columns should be named: "Time", "RH", "Temperature", "TGS4161", "MICS2714", "TGS2442", "MICS5524", "TGS2602", "TGS2620". The separator of columns of these files is a '\t'. So, a suggestion of code to read these files is presented below:
"""

def preprocess_time_column(df, column_name):
    # Convertir en premier en datetime pour s'assurer que toutes les valeurs soient interprétables
    df[column_name] = pd.to_datetime(df[column_name], dayfirst=True, errors='coerce')

    # Localiser en 'Europe/Paris' si pas déjà localisé
    if df[column_name].dt.tz is None:
        df[column_name] = df[column_name].dt.tz_localize('UTC').dt.tz_convert('Europe/Paris')
    else:
        df[column_name] = df[column_name].dt.tz_convert('Europe/Paris')

    return df

fichiers = []

TP_PATH = "/content/drive/My Drive/Projet Data Science/"

# Initialize empty DataFrames for each module
modules_data = {}

# Read and process data for each part of each module
for mod_num in range(1, 3):
    # Initialize an empty list to store DataFrames of each part
    part_dfs = []

    # Read and process data for each part
    for part_num in range(1, 9):
        file_path = f"{TP_PATH}TP Data 2024 - FISA/Libelium New/part{part_num}/mod{mod_num}.txt"
        part_df = pd.read_csv(file_path, sep="\t", header=None, names=("Time","RH","Temperature","TGS4161","MICS2714","TGS2442","MICS5524","TGS2602","TGS2620"))

        # Convert Time column to datetime and adjust timezone
        part_df = preprocess_time_column(part_df, 'Time')

        # Append DataFrame of each part to the list
        part_dfs.append(part_df)

    # Concatenate DataFrames of all parts into a single DataFrame for each module
    modules_data[f'mod{mod_num}'] = pd.concat(part_dfs)

"""There are 8 parts for each "mod", so you should group all the 8 parts of each module into a single one (tip: pd.concat() function) and **save it in a .txt file**. Namely, one file representative of the data in "mod1" and another representative of the data in "mod2" (see pd.to_csv()). **The files must have the columns names!**
Don't forget to convert the data in the "Time" column into a **datetime** format and put them in the **correct timezone ("UTC+01:00")**. You can use the following piece of code to do that:

**And drop the duplicates!**
"""

for mod_name, mod_df in modules_data.items():
    modules_data[mod_name] = mod_df.drop_duplicates()

# Save the concatenated DataFrames for each module into .txt files
for mod_name, mod_df in modules_data.items():
    # Save as .txt file with tab-separated values and datetime format for the "Time" column
    mod_df.to_csv(f"{TP_PATH}TP Data 2024 - FISA/Libelium New/{mod_name}.txt", sep="\t", date_format='%Y-%m-%d %H:%M:%S', index=False)

